        retain_keyPersonData.CUSTOMER_KEY_PERSON_ADDRESS_CITY = vayIndKeyPersonAddCity.text
        retain_keyPersonData.CUSTOMER_KEY_PERSON_ADDRESS_DISTRICT = vayIndKeyPersonAddDistrict.text
        retain_keyPersonData.CUSTOMER_KEY_PERSON_ADDRESS_STATE = vayIndKeyPersonAddState.text
        retain_keyPersonData.CUSTOMER_KEY_PERSON_ADDRESS_COUNTRY = vayIndKeyPersonAddCountry.selectedOptionValue
        retain_keyPersonData.CUSTOMER_KEY_PERSON_ADDRESS_ZIP = vayIndKeyPersonAddPinCode.text
